import React from 'react';
import './Button.css';

const Button = ({ onClick, label, disabled = false }) => {
  return (
    <button 
      className={`custom-button ${disabled ? 'disabled' : ''}`}
      onClick={onClick}
      disabled={disabled}
    >
      {label}
    </button>
  );
};

export default Button;
